import { Schema, model } from "mongoose";


const schema = new Schema({
    nombre_usuario : {
        type: String,
    },
    personaje : {
        type: String
    }, 
    sala : {
        type: String
    },
    participantes : {
        type: Array
    },
    estado : {
        type: Boolean
    },
    

},{
    timestamps: true
})

export default model ('Note', schema)

